<!DOCTYPE html>
<html >
<head>
	<meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
    <base href="/">
	<title></title>
	<meta name="description" content="">
	<meta name="author" content="">
	<meta name="viewport" content="width=device-width,initial-scale=1"> 
    <style>
        body {
            font-size: 16px;
            color: #4a4a4a;
            line-height: 1.45em;
            font-family: 'Roboto', Arial, Helvetica, sans-serif;
        }

        body, html {
            margin: 0;
            padding: 0;
            height: 100%;
        }

        body * { box-sizing: border-box; }
        p { margin: 0 0 16px 0;}

        h1, h2 {
            color: #000;
            margin: 0;
        }

        #container {
            height: 100vh;
            max-width: 1440px;
            margin: 0 auto;
            display: flex;
            flex-flow: column nowrap;
            justify-content: flex-start;
        }

        main, header {
            width: 100%;
        }

        header { margin-top: auto; padding: 1% 4.5%;}
        main { margin-bottom: auto; }

        .logo {
            display: flex;
            flex-flow: row nowrap; 
            align-items: center;
            justify-content: center;
            font-size: 14px;
        }

        .logo img { 
            margin-right: 16px;
            width: 3.4em;
        }
        .logo h1 { 
            font-size: 1em; 
            margin: 0; 
            font-weight: normal; 
            line-height: 1.3em; 
            color: #000;
        }
        .logo h1 strong { 
            display: block; 
            font-size: 2em; 
            line-height: 1em;
        }

        main { text-align: center;}
        small { font-size: 0.85em; color: #89878a;}

        main .cover { 
            width: 100%; 
            max-width: 1050px; 
            overflow: hidden;
            margin: 0 auto;
            display: flex;
            align-items: flex-end;
            justify-content: center;
        }

        main .cover img {
            position: relative;
            width: 100%;
            max-width: 1050px;
        }

        main .container {
            padding: 0 4.5%;
        }

        h2 {
            color: #000; 
            line-height: 1em;
            font-size: 21px;
            margin: 0.25em 0;
        }

        @media (min-width: 768px) {
            h2 {
                font-size: 2.25em;
            }

            .logo { 
                justify-content: flex-start;
                font-size: 18px;
            }

            main .container { padding-bottom: 4.5%; padding-top: 4.5%; }
        }

        @media (max-height: 812px) and (max-width: 500px ) {
            main .cover img { width: auto; height: 45vh;  }
        }

        @media (max-height: 768px) and (min-width: 500px ) {
            main .cover img { width: auto; height: 50vh; }
        }

        .btn {
            display: block;
            text-decoration: none;
            width: 100%;
            max-width: 216px;
            height: 40px;
            line-height: 40px;
            margin: 0 auto;
            border: 0 none;
            background: #0078d7;
            color: #fff;
            font-size: 14px;
            border-radius: 4px;
            text-transform: uppercase;
            cursor: pointer;
            transition: background 250ms ease-in;
        }

        .btn:hover {
            background-image: radial-gradient(circle, rgba(255,255,255,0.15) 1%, transparent 1%);
            background-image: linear-gradient(rgba(255,255,255,0.15), rgba(255,255,255,0.15));
            background-size: 15000%;
        }
    </style>
</head>
